oxy_webhelp_navlinks = {"m365_b_s_protection-d22908e33204":{"topics":[{"title":"Managing protection for M365 applications","shortdesc":"<p class=\"shortdesc\">Manage protection for Microsoft 365 applications such as SharePoint sites, OneDrive         user accounts, and Exchange mailboxes using Microsoft 365 Backup Storage. You can protect         Microsoft 365 applications by assigning a data protection policy predefined by Microsoft and         specified in the SLA Domain.<\/p>","href":"m365_backup_storage\/m365_b_s_managing_protection_apps.html","attributes":{"data-id":"m365_b_s_managing_protection_apps"},"menu":{"hasChildren":false},"tocID":"m365_b_s_managing_protection_apps-d22908e33215","topics":[]},{"title":"Managing protection for M365 objects","shortdesc":"<p class=\"shortdesc\">Manage protection for the objects associated with Microsoft 365 applications such as         SharePoint sites, OneDrive user accounts, and Exchange mailboxes using Microsoft 365 Backup         Storage. You can protect the objects associated with Microsoft 365 applications by assigning         a data protection policy predefined by Microsoft and specified in the SLA         Domain.<\/p>","href":"m365_backup_storage\/m365_b_s_managing_obj_protection.html","attributes":{"data-id":"m365_b_s_managing_obj_protection"},"menu":{"hasChildren":false},"tocID":"m365_b_s_managing_obj_protection-d22908e33226","topics":[]},{"title":"Protection hierarchy for M365 applications and objects","shortdesc":"<p class=\"shortdesc\"><span class=\"ph\">RSC<\/span> provides hierarchy-based automatic protection to Microsoft 365         applications and its objects using Microsoft 365 Backup Storage.<\/p>","href":"m365_backup_storage\/m365_b_s_protection_hierarchy.html","attributes":{"data-id":"m365_b_s_protection_hierarchy"},"menu":{"hasChildren":false},"tocID":"m365_b_s_protection_hierarchy-d22908e33237","topics":[]}]}};